import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Navbar from "./components/Navbar";
import ProductsPage from "./pages/ProductsPage";
import LoginPage from "./pages/LoginPage";
import CartPage from "./pages/CartPage";
import { StoreProvider } from "./context/StoreContext";

export default function App() {
  return (
    <StoreProvider>
      <Router>
        <Navbar />
        <Routes>
          <Route path="/" element={<ProductsPage category="todos" />} />
          <Route path="/bebidas" element={<ProductsPage category="bebidas" />} />
          <Route path="/alimentos" element={<ProductsPage category="alimentos" />} />
          <Route path="/hogar" element={<ProductsPage category="hogar" />} />
          <Route path="/login" element={<LoginPage />} />
          <Route path="/carrito" element={<CartPage />} />
        </Routes>
      </Router>
    </StoreProvider>
  );
}
